import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Avatar from '@material-ui/core/Avatar';
import { deepOrange, deepPurple } from '@material-ui/core/colors';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

const useStyles = makeStyles((theme) => ({
    root: {
        marginTop: 40,
        marginLeft:60,
        marginRight:60
    },
    rootGrid: {
        flexGrow: 1,
        padding: 50
      },
    productBuzz: {
        border: "1px solid",
    }, 
    paper: {
        padding: theme.spacing(1),
        textAlign: 'center',
        padding: 40
      },
  }));
  
export const ProductBuzz = () => {
    const classes = useStyles();

    function FormRow({num}) {
        return (
          <React.Fragment>
            <Grid item xs={2}>
              <Paper className={classes.paper}>Product {num+1}</Paper>
            </Grid>
            <Grid item xs={2}>
              <Paper className={classes.paper}>Product {num+2}</Paper>
            </Grid>
            <Grid item xs={2}>
              <Paper className={classes.paper}>Product {num+3}</Paper>
            </Grid>
            <Grid item xs={2}>
              <Paper className={classes.paper}>Product {num+4}</Paper>
            </Grid>
            <Grid item xs={2}>
              <Paper className={classes.paper}>Product {num+5}</Paper>
            </Grid>
            <Grid item xs={2}>
              <Paper className={classes.paper}>Product {num+6}</Paper>
            </Grid>
          </React.Fragment>
        );
      } 


    return (
    <div className={classes.root}>
        <h5>Product Buzz</h5>
        <div className={classes.productBuzz}>
        <div className={classes.rootGrid}>
            <Grid container spacing={2}>
                <Grid container item xs={12} spacing={3}>
                <FormRow num={0} />
                </Grid>
                <Grid container item xs={12} spacing={3}>
                <FormRow num={6}/>
                </Grid>
            </Grid>
    </div>
        </div>
    
    </div>)
}
